INSERT INTO `event` VALUES (3,'de6e80','Membantu Pihak UMKM dalam hal penyediaan stok barang','2022-09-09','2022-09-09 08:00:00','2022-09-09 10:00:00','Bungaran Martua Pakpahan',NULL,'wa.me/+628137068001','bungaranmart2001@gmail.com',NULL,'Webinar akan menjelaskan','https://meet.google.com/uyt-uhmv',NULL,0,'2022-09-08 10:25:16',1),(5,'02a10d','Membantu pihak UMKM  dalam hal penyediaan stok barang','2022-09-09','2022-09-09 10:00:00','2022-09-09 12:00:00','Bungaran Martua Pakpahan',NULL,'wa.me/+6281370680001','bungaranmart2001@gmail.com','2022-09-08_103250_80875_poster_event.jpg','Webinar akan menjelaskan bagaimana pihak UMKM dalam Manajemen inventory penyediaan stok barang dengan metode Algoritma Clustering yang akan disampaikan.','https://meet.google.com/uyi-uhmw-wfj',NULL,0,'2022-09-08 10:32:50',0),(6,'9c3358','Manajemen inventory UMKM dalam hal penyediaan stok barang','2022-09-09','2022-09-09 10:00:00','2022-09-09 12:00:00','Bungaran Martua Pakpahan',NULL,'wa.me/+6281370680001','bungaranmart2001@gmail.com','2022-09-08_132735_08459_poster_event.jpg','Webinar akan menjelaskan bagaimana pihak UMKM dalam Manajemen inventory penyediaan stok barang dengan metode Algoritma Clustering yang akan disampaikan.','https://meet.google.com/uyi-uhmw-wfj',NULL,1,'2022-09-08 13:27:36',0),(7,'6ac68b','Problem Solving Dengan Machine Learning','2022-09-15','2022-09-15 12:30:00','2022-09-15 14:30:00','Teguh Dayanto, S.T.',NULL,'wa.me/+6281227515025','teguh@gmail.com',NULL,'[Pembelajaran Tamu]\n\nProblem Solving Dengan Machine Learning\n\nMachine Learning merupakan sebuah teknologi dimana mesin bisa belajar layaknya manusia. Pada dasarnya Machine Learning dapat mempelajari sebuah data yang ada dengan tugas tertentu. Pada webinar ini akan dibahas mengenai Problem Solving Dengan Machine Learning, Dengan :\n\nNarasumber : \nTeguh Dayanto, S.T.\nMentor SIB BISA AI Academy\n\nWaktu : \nSenin,12 September 2022\n19.00 - 21.00 WIB\n\nLink Pendaftaran:\nhttps://tampil.id','https://tampil.id/event/detail/VFdwWk1VNW5QVDA9',NULL,0,'2022-09-09 09:05:38',1),(8,'886c07','Society ERA 5.0 : Peluang, Tantangan dan Masa Depan','2022-10-22','2022-10-22 08:30:00','2022-10-22 10:30:00','Anwar Sanusi',NULL,'wa.me/+6287863825615','anwarsanusisan@gmail.com','2022-09-10_104259_72617_poster_event.jpg','Mengenalkan society era 5.0 kepada masyarakat beserta latar belakang yang mendasari munculnya era tersebut dan bagaimana masyarakat menghadapi era tersebut dengan melihat peluang tantangan yang akan datang demi masa depan masyarakat kedepannya.','https://meet.google.com/qpf-jjbs-gwh',NULL,1,'2022-09-10 10:42:59',0),(9,'44e9d9','Testing Webinar Testing','2022-12-01','2022-12-01 09:00:00','2022-12-01 10:30:00','Hanif Radityo',NULL,'wa.me/+6281227515025','radityo.hanif@gmail.com',NULL,'Webinar yang membahas embrio AI dari abad ke-7 beserta teknologi terkait. Berlanjut ke perkembangan AI di masa Rene Descrates dan Alan Turing. Tak lupa juga disinggung AI di Revolusi Industri 4.0 dan prediksi AI di masa depan','https://tampil.id/event/detail/VFdwWk1FNVJQVDA9',NULL,0,'2022-09-12 17:23:15',1),(10,'cc537c','SUPPORT UMKM 101: Transformasi bisnis konvensional  ke bisnis digital','2022-09-30','2022-09-30 19:00:00','2022-09-30 21:00:00','Josua Sabar Krisnando',NULL,'wa.me/+6288296238043','sitiameliaf6@gmail.com','2022-09-12_183010_54111_poster_event.jpg','Dalam Webinar Support UMKM 101 akan dipaparkan materi seputar:\n- Tren pertumbuhan transformasi digital\n- Memahami konsep digitalisasi bisnis\n- Mengenal peluang baru di era digitalisasi\n- Dasar/basic pemasaran melalui internet, metode hook & bait','https://meet.google.com/udh-pfjg-bvw',NULL,1,'2022-09-12 18:30:10',0),(12,'a46eb6','Market Research Analysis','2022-09-14','2022-09-14 13:00:00','2022-09-14 15:00:00','Fathiyah Ayyasy',NULL,NULL,NULL,'2022-09-13_093907_69608_poster_event.jpg','Pengenalan marketing analisis, analisis kompetitor, sosmed analysis, ATM, membuat keputusan berdasarkan analisis.','https://meet.google.com/ckx-opio-mcv',NULL,0,'2022-09-13 09:39:07',0),(13,'a24028','Market Research Analysis','2022-09-14','2022-09-14 13:00:00','2022-09-14 15:00:00','Fathiyah Ayyasy',NULL,NULL,NULL,'2022-09-13_121745_24705_poster_event.jpg','Pengenalan marketing analisis, analisis kompetitor, sosmed analysis, ATM, membuat keputusan berdasarkan analisis.','https://tampil.id/join/room/wbO93e6E8K','723385',1,'2022-09-13 12:17:46',0),(14,'5f9c28','Profesionalitas','2022-09-15','2022-09-15 13:00:00','2022-09-15 15:00:00','Neni Alyani',NULL,NULL,NULL,'2022-09-13_133433_66081_poster_event.jpg','Profesi merupakan ciri seseorang dengan utuh keahliannya sehingga penting dimiliki','https://tampil.id/join/room/wbO93e6E8K','723385',1,'2022-09-13 13:34:33',0),(15,'4b65ec','Komunikasi Efektif','2022-09-14','2022-09-14 10:30:00','2022-09-14 12:00:00','Yuni Widiastiwi, S.Kom., M.Si.',NULL,NULL,NULL,'2022-09-13_194221_53298_poster_event.jpg','Pertukaran informasi, ide, perasaan yang menghasilkan perubahan sikap sehingga terjalin sebuah hubungan baik antara pemberi pesan dan penerima pesan.','https://tampil.id/join/room/wbO93e6E8K','723385',1,'2022-09-13 19:42:21',0),(16,'53a2ec','PREPOCESSING DATA WITH PYTHON & BASIC EXCEL : FORMATING, FORMULAS, VISUALIZATION, PREDICTIONS','2022-09-17','2022-09-17 10:00:00','2022-09-17 12:00:00','AZY UMARDI AZHRA',NULL,'wa.me/+6281585648519','azyua@upnvj.ac.id','2022-09-14_112348_59649_poster_event.jpg','Webinar ini akan menjelaskan bagaimana penggunaan Excel atau penjelasan menegenai Basic Excel. Mulai dari Formating, Implementasi formula, visualisasi data, dan prediksi penjualan untuk bisnis.  Webinar ini sangat bermanfaat untuk para pelajar Tingkat Awal, menengah, Kuliah, hingga para pelaku UMKM.','https://zoom.us/j/2678432786?pwd=TXVqa1E4Mkl0QldHTlhpNksyc2piUT09','FGm24s',1,'2022-09-14 11:23:48',0);
